import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  render() {

    return(
      <div> 
        {this.props.pokemons.map((animal) => <Pokemon key={animal.id} seila={animal} />)}
      </div>
    )
  }
}

export default Pokedex;
